import "./Payment.css";
import TopMenu from "../TopMenu/TopMenu";
import Loaderspiner from "../Loaderspiner/Loaderspiner";

class Payment extends Component{
    constructor(props) {
        super(props);
        
        this.state={
          isprocecing:false,
          statuspayment:false,

      
    };
    
    
}

    componentDidMount = () => {
      
        



    }
   
  
 
              
   
             
   
         
   
    
    render(){
      const {isprocecing,statuspayment,statuspaymentdiv}=this.state;
        return(
          <div key={"paymentdiv"}>
             <TopMenu></TopMenu>
              <div  className="kontentpayment" key="kontentpayment">
                <div className="kontentpaymenttitle" key="kontentpaymenttitle">Status twojej płatności</div>
                 {!isprocecing?[
                  <div >Oczekujemy na potwierdzenie płatności od dostawcy płatności  
                    <Loaderspiner/>
                  </div>

                 ]:[
                  <div >Twoja płatność:
                </div>                
            
                 ]}
                 {statuspayment?     statuspaymentdiv:""}

                 
                 </div>
              
          </div>
         
       
        )
}
}
export default Payment
